GBF-TARGET-15Description:
Gumawa ng mga hakbang sa ligal, administratibo o patakaran upang hikayatin at paganahin ang negosyo, at sa partikular upang matiyak na ang malalaking at transnational na kumpanya at institusyong pampinansyal: 

(a) Regular na subaybayan, suriin, at malinaw na ibunyag ang kanilang mga panganib, depende at epekto sa biodiversidad, kabilang ang mga kinakailangan para sa lahat ng malalaking at transnational na kumpanya at institusyong pampinansyal sa kanilang mga operasyon, supply at value chain at portfolio;

(b) Magbigay ng impormasyong kinakailangan sa mga mamimili upang itaguyod ang napapanatiling mga pattern 

(c) Mag-ulat tungkol sa pagsunod sa mga regulasyon at hakbang sa pag-access at pagbabahagi ng benepisyo, ayon sa naaangkop;

upang unti-unting mabawasan ang mga negatibong epekto sa biodiversidad, dagdagan ang mga positibong epekto, bawasan ang mga panganib na nauugnay sa biodiversidad sa mga institusyong negosyo at pinansyal, at itaguyod ang mga aksyon upang matiyak ang napapanatiling mga pattern
